$installWidgetsC->installTable('library.languages',$this->_installValuesA());
}
$newFlex=WPref::load('PLIBRARY_NODE_AJAXPAGE');
$pref=WPref::get('library.node');
$pref->updatePref('ajaxpage',$newFlex );
$fileS=WGet::folder();
if($fileS->exist( JOOBI_DS_NODE.'iptracker')){
$fileS->delete( JOOBI_DS_NODE.'iptracker');
if('joomla'==JOOBI_FRAMEWORK_TYPE){
$widgetM=WTable::get('extensions','','extension_id');
$widgetM->whereE('element','iptracker_system_plugin');
$widgetM->delete();
}
}
return true;
}
